import React from 'react';
import OpenStreetMap from './OpenStreetMap';

const App = () => {
  return (
    <div className="app">
      <header>
        <h1>Hallo with JSX</h1>
      </header>
      
      <main>
        <OpenStreetMap />
      </main>
      
      <footer>
        <p>&copy; {new Date().getFullYear()} - OpenStreetMap JSX Demo</p>
      </footer>
      
      <style jsx>{`
        .app {
          text-align: center;
        }
        
        header {
          background-color: #2c3e50;
          color: white;
          padding: 20px;
          margin-bottom: 20px;
        }
        
        h1 {
          margin: 0;
          font-size: 24px;
        }
        
        main {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 20px;
        }
        
        footer {
          margin-top: 30px;
          padding: 15px;
          background-color: #f5f5f5;
          color: #666;
          font-size: 14px;
        }
      `}</style>
    </div>
  );
};

export default App;
